{
  "filterBy":[{
      "name": "NodeIdent",
      "mustExist": true
    },
    {
      "name": "ClusterName",
      "mustExist": true
    }],
    "timestampBinName": "timestamp",
    "groupBy": [{
    	"name": "ClusterName",
    	"required": true
    },{
    	"name": "NodeIdent",
    	"required": true    
    }],
    "bins": [{
    	"name": "HBForeign",
