    	"displayName": "Self",
    	"type": "number",
    	"required": true,
    	"maxIntervalSeconds": $MaxIntervalSeconds,
      "tickerIntervalSeconds": $TickerIntervalSeconds,
      "reverse": true,
      "produceDelta": $ProduceDelta,
      "limits": {
        "maxValue": 0
      }
    }]
}

